import React,{Component} from 'react';
import  {Navbar ,NavbarBrand} from 'reactstrap';
import {BrowserRouter as Router,Route,Link} from 'react-router-dom';

import Body from './components/body';
import Register from './components/register';
import Login from './components/login';
import Navi from './components/Navi';
import Home from './components/home';
import Debit from './components/debit';
import Credit from './components/credit';
import Wallets from './components/Wallets';
import Status from './components/status';
import Footer from './components/footer';
import Statement from './components/statement';
import Default from "./components/default";




function App() {
  return (
    <div className="App">

        <Router>
            <Navi/>
                  <Route exact path='/' render={()=><Body/>}/>
                  <Route exact path='/log' render={()=><Login/>}/>
                  <Route exact path='/register' render={()=><Register/>}/>
                  <Route exact path='/home' render={()=><Home/>}/>
                  <Route exact path='/debit' render={()=><Debit/>}/>
                  <Route exact path='/credit' render={()=><Credit/>}/>
                  <Route exact path='/wallets' render={()=><Wallets/>}/>
                  <Route exact path='/status' render={()=><Status/>}/>
                  <Route exact path='/statement' render={()=><Statement/>}/>
                  <Route exact path='/default' render={()=><Default/>}/>
            <Footer/>
        </Router>
    </div>
  );
}

export default App;
